import React, {Component} from 'react';
import PropTypes from 'prop-types';

export default class TaskForm extends Component {

    state = {
        title: '',
        description: ''
    }

    alEnviar = (evento) => {
        evento.preventDefault();        
    }

    alCambiar = (evento) => {
        this.setState({
            title: evento.target.value
        })
    }

    render () {
        return (
            <form onSubmit = {this.alEnviar}>
                <input type ="text" placeholder="Write a task" onChange = {this.alCambiar} value={this.state.title}/>
                <br />
                <br />
                <textarea placeholder="Write a description" onChange = {this.alCambiar} value={this.state.description}></textarea>
                <input type="submit" />
            </form>
        )        
    }

}
